import React from "react";

function Home() {
  return (
    <div className='nothing' style={{ textAlign: "center" }}>
      <img className='backgroundImage' src='../uploads\background.jpg ' alt='backgroundimage' />
      <h1 style={{ position: "absolute", top: "100px", color: "white" }} className='hometitle'>
        FPV Build
      </h1>
      <h3 className='homeundertitle' style={{ position: "absolute", top: "260px", color: "white" }}>
        {" "}
        Share Your KWAD Build
      </h3>
    </div>
  );
}

export default Home;
